create database agroquimicosEquipo2
go
--Equipo:
--Campaña Cano Oliver Ricardo
--Lopez Castañeda Jesus Saul

use agroquimicosEquipo2

create table producto
(
	upcProducto bigint NOT NULL PRIMARY KEY,
	familiaProducto varchar(14),
	costoVentas money,
	costoCompras money,
	tamanoProducto varchar(6),
	existenciaProducto int,
	repartoProducto varchar(9)
)

create table proveedor
(
	codigoProveedor int NOT NULL PRIMARY KEY,
	nombreProveedor varchar(30),
	telefonoProveedor varchar(11),
	upcProducto bigint FOREIGN KEY REFERENCES producto(upcProducto)
)

create table cliente
(
	codigoCliente int NOT NULL PRIMARY KEY,
	nombreCliente varchar(30),
	telefonoCliente varchar(11),
	direccionCliente varchar(60),
	giroCliente varchar(11),
	upcProducto bigint FOREIGN KEY REFERENCES producto(upcProducto)
)

create table ventas
(
	codigoVentas int NOT NULL PRIMARY KEY,
	precioVentas money,
	tipoVenta varchar(8),
	upcProducto bigint FOREIGN KEY REFERENCES producto(upcProducto)
)

alter table proveedor
	add constraint telefonoProveedor_valido check (telefonoProveedor like '[0-9][0-9][0-9]-[0-9][0-9][0-9][0-9][0-9][0-9][0-9]')

alter table cliente
	add constraint telefonoCliente_valido check (telefonoCliente like '[0-9][0-9][0-9]-[0-9][0-9][0-9][0-9][0-9][0-9][0-9]')

